import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="ui vertical pointing menu">
      <Link to="/jobs/recent" className="active item">
        Recent Jobs
      </Link>
      <Link to="/jobs/annotations" className="item">
        New Jobs
      </Link>
    </div>
  );
};

export default Navbar;
